SA STRONG: “It makes it worth it.” Local muralist, Joseph Ramey, 25, is sharing his passion for art in San Antonio. 

Ramey started painting murals one year ago. He was selected to paint his first one in the Alamo City, right across the street from the hospital his mother, Sharon, worked at when she was pregnant with him. 

“It’s amazing how the universe comes full circle.”

